function constraints(gap, len) {
    this.reset();
    var noteProto = this.get("Note"), music = this.get("Music");
    noteProto.reset();
    Global.bbb.defaultSolver = new Global.BacktalkSolver();
    this.voice1 = Array.range(1, len).map(function(i) {
        var note = noteProto.copy();
        music.addMorph(note);
        note.time = i;
        Global.bbb.always({
            ctx: {
                noteProto: noteProto,
                music: music,
                note: note,
                i: i,
                _$_self: this.doitContext || this
            }
        }, function() {
            return note.note.is in _$_self.voice1Chords();;
        });
        Global.bbb.always({
            ctx: {
                noteProto: noteProto,
                music: music,
                note: note,
                i: i,
                _$_self: this.doitContext || this
            }
        }, function() {
            return note.length.is in [ 8, 16, 32, 64, 128 ];;
        });
        return note;
    }.bind(this));
    this.voice2 = Array.range(1, len + gap).map(function(i) {
        var note = noteProto.copy();
        if (i <= len) music.addMorph(note);
        note.time = i;
        Global.bbb.always({
            ctx: {
                noteProto: noteProto,
                i: i,
                len: len,
                music: music,
                note: note,
                _$_self: this.doitContext || this
            }
        }, function() {
            return note.note.is in _$_self.voice2Chords();;
        });
        Global.bbb.always({
            ctx: {
                noteProto: noteProto,
                i: i,
                len: len,
                music: music,
                note: note,
                _$_self: this.doitContext || this
            }
        }, function() {
            return note.length.is in [ 8, 16, 32, 64, 128 ];;
        });
        return note;
    }.bind(this));
    this.voice1.each(function(note1, idx) {
        var note2 = this.voice2[idx], note2gap = this.voice2[idx + gap], self = this;
        Global.bbb.always({
            priority: "strong",
            ctx: {
                idx: idx,
                gap: gap,
                self: self,
                note1: note1,
                note2gap: note2gap,
                note2: note2,
                len: len,
                _$_self: this.doitContext || this
            }
        }, function() {
            return self.isValidBichord(note1.note, note2gap.note);;
        });
        Global.bbb.always({
            ctx: {
                idx: idx,
                gap: gap,
                self: self,
                note1: note1,
                note2gap: note2gap,
                note2: note2,
                len: len,
                _$_self: this.doitContext || this
            }
        }, function() {
            return note1.length === note2.length;;
        });
        note1.length = Math.pow(2, Math.round(Math.random() * 2 + 4));
        for (var i = idx + 1; i < len && i <= idx + gap; i++) {
            var note1f = this.voice1[i], note2f = this.voice2[i];
            Global.bbb.always({
                ctx: {
                    idx: idx,
                    gap: gap,
                    self: self,
                    note1: note1,
                    note2gap: note2gap,
                    note2: note2,
                    Math: Math,
                    i: i,
                    len: len,
                    note1f: note1f,
                    note2f: note2f,
                    _$_self: this.doitContext || this
                }
            }, function() {
                return note1.note !== note1f.note || note2.note !== note2f.note;;
            });
        }
    }.bind(this));
}

